  [],\n\t\"revision_timestamp\": \"2016-07-27T22:45:14.655282\",\n\t\"name\": \"crab-orchard-national-wildlife-refuge-annual-narrative-january-april-1948\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Crab Orchard
  National Wildlife Refuge outlines Refuge accomplishments from January through April
  of 1948. The report begins by summarizing the weather conditions, water conditions,
  and food and cover during this period. Wildlife- including migratory birds, upland
  game birds, big game animals, furbearers, predators, rodents, raptors, and fish-
  is also covered. The Refuge development and maintenance section discusses physical
  developments, plantings, and wildfires. Resource management is outlined; topics
  include grazing and fur harvesting. A progress report on field investigations and
  applied research is also provided. The public relations section of the report describes
  recreational uses, Refuge visitors, Refuge participation, fishing, and violations.
  N-R forms, photographs, and newspaper articles are attached.\",\n\t\"license_title\":
